import React from "react";
import "./App.css";
import { Link, NavLink, Route, Routes } from "react-router-dom";
import { Home } from "./pages/Home";
import { Portfolio } from "./pages/Portfolio";

function App() {
  return (
    <>
      <NavLink className="navigation flex" to={"/"}>


        <div className="nav__content">
          <ul className="nav__list">
            <li>
              <Link to={"/"} className="nav__list-item">Home</Link>
            </li>
            <li>
              <Link to={"/"} className="nav__list-item">About</Link>
            </li>
            <li>
              <Link to={"/portfolio"} className="nav__list-item">Portfolio</Link>
            </li>
            <li>
              <Link to={"/"} className="nav__list-item">Contact</Link>
            </li>
          </ul>
        </div>
      </NavLink>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/portfolio" element={<Portfolio />} />
      </Routes>
    </>
  );
}

export default App;
